import React, { useState, useEffect } from 'react';
import { doctorAPI } from '../../api/endpoints';

const DoctorQueue = () => {
  const [queue, setQueue] = useState([]);

  useEffect(() => {
    fetchQueue();
  }, []);

  const fetchQueue = async () => {
    try {
      const response = await doctorAPI.getQueue();
      setQueue(response.data);
    } catch (error) {
      console.error('Error fetching queue:', error);
    }
  };

  return (
    <div className="doctor-queue">
      <h2>Patient Queue</h2>
      <div className="queue-list">
        {queue.map((item, index) => (
          <div key={item.id} className="queue-item" onClick={() => window.location.href = `/doctor/patient/${item.patient_id}`}>
            <span className="queue-number">{index + 1}</span>
            <div className="patient-info">
              <h4>{item.patient_name}</h4>
              <p>Status: {item.status}</p>
              <button className="start-exam-btn">Start Exam</button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default DoctorQueue;
